import {Component} from "react";
import { Priority } from "../../../constants";
export class PrioritySelector extends Component{

    render(){
        const [parentChangeHandler, parentValue] = this.props;

        return <label>Приоритет
                    <select onChange={parentChangeHandler} 
                            value={parentValue}>
                        {Priority.map(option=> <option {...option}></option>)}
                    </select>
                </label>
    }
}
